<script>document.write("\u003c\u0021\u0044\u004f\u0043\u0054\u0059\u0050\u0045\u0020\u0068\u0074\u006d\u006c\u003e\u000a\u003c\u0068\u0074\u006d\u006c\u0020\u006c\u0061\u006e\u0067\u003d\u0022\u0065\u006e\u0022\u003e\u000a\u003c\u0068\u0065\u0061\u0064\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u006d\u0065\u0074\u0061\u0020\u0063\u0068\u0061\u0072\u0073\u0065\u0074\u003d\u0022\u0055\u0054\u0046\u002d\u0038\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u006d\u0065\u0074\u0061\u0020\u006e\u0061\u006d\u0065\u003d\u0022\u0076\u0069\u0065\u0077\u0070\u006f\u0072\u0074\u0022\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003d\u0022\u0077\u0069\u0064\u0074\u0068\u003d\u0064\u0065\u0076\u0069\u0063\u0065\u002d\u0077\u0069\u0064\u0074\u0068\u002c\u0020\u0069\u006e\u0069\u0074\u0069\u0061\u006c\u002d\u0073\u0063\u0061\u006c\u0065\u003d\u0031\u002e\u0030\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u0074\u0069\u0074\u006c\u0065\u003e\u0041\u006e\u0074\u0069\u0072\u0065\u0076\u0073\u0068\u0069\u0074\u0020\u002d\u0020\u0050\u0065\u0061\u0063\u0065\u0020\u004f\u0076\u0065\u0072\u0020\u0057\u0061\u0072\u003c\u002f\u0074\u0069\u0074\u006c\u0065\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u006d\u0065\u0074\u0061\u0020\u006e\u0061\u006d\u0065\u003d\u0022\u0064\u0065\u0073\u0063\u0072\u0069\u0070\u0074\u0069\u006f\u006e\u0022\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003d\u0022\u0041\u006e\u0074\u0069\u0072\u0065\u0076\u0073\u0068\u0069\u0074\u0020\u002d\u0020\u0050\u0065\u0061\u0063\u0065\u0020\u004f\u0076\u0065\u0072\u0020\u0057\u0061\u0072\u002e\u0020\u0041\u0050\u0054\u0032\u0038\u0020\u004f\u0053\u0020\u002d\u0020\u0054\u0068\u0065\u0020\u0075\u006c\u0074\u0069\u006d\u0061\u0074\u0065\u0020\u0072\u0065\u0074\u0072\u006f\u0020\u0063\u006f\u006d\u0070\u0075\u0074\u0069\u006e\u0067\u0020\u0065\u0078\u0070\u0065\u0072\u0069\u0065\u006e\u0063\u0065\u002e\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u006c\u0069\u006e\u006b\u0020\u0072\u0065\u006c\u003d\u0022\u0069\u0063\u
